import React from "react";
 function Navi(){
    return(
    <>
        <h3>this is my navigation component</h3>,

        <ul>
            <li>Homes</li>
            <li>About</li>
            <li>Contact</li>
            <li>Services</li>
            <li>Achivements</li>

        </ul>
</>
    );
 }




export default Navi;
